Performing the subtraction in base 10: 
30782 - 27557 = 3225
Converting 3225_{10} to base 12:
3225 = 12^3 * 2 + 12^2 * 4 + 12^1 * 7 + 12^0 * 9 = 2479_{12}

Therefore, 17482_{12} - 16519_{12} = 2479_{12}.

